const Footer = () => (
    <div>
        <div className="footer">
            <p className="text-center" className="fooeter_text">
                Copyright@ 2020
                    <span> Muhalik </span>
                - Online Shopping Website
            </p>
        </div>
        <style jsx>{`
            .footer {
                background: red;
                position: absolute;
                left: 0;
                bottom: 0;
                right: 0;
            }
            .fooeter_text {
                margin: 10px;
                font-size: smaller;
                color: blue;
                color: ${primary_text_color};
            }
            span {
                font-weight: bold;
            }
        `}</style>
    </div>
)

export default Footer;
